class Trie:#前缀树
    def __init__(self):
        self.dic = {}
    def insert(self,word):
        dic_todo = self.dic
        for i in word:
            if i in dic_todo:
                dic_todo = dic_todo[i]
            else:
                dic_todo[i] = {}
                dic_todo = dic_todo[i]
        dic_todo['99999'] = 1
        #print(self.dic)
    def show(self):
        return self.dic
class Solution:  
    def in_t(self,words):#words转化为前缀树，返回字典
        print('in_t1')
        Trie_todo = Trie()
        self.chongfu = []
        for i in words:
            Trie_todo.insert(i)
        return Trie_todo.show()        

    def search1(self,dic,board,words):#遍历找开始的位置
        print('search1')
        dic_todo = dic
        words_todo = words
        board_todo = board
        ans = []
        for i in range(len(board)):
            for j in range(len(board[i])):
                dic_todo = self.in_t(words_todo)
                if board[i][j] in dic_todo:#如果头相同
                    s = self.search2(dic_todo,board_todo,(i,j))
                    if s:
                        #print((i,j))
                        ans.append(s)
                        words_todo.remove(s)
        return ans

    def search2(self,dic,board,tup):#返回False或者值
        print('search2')
        i,j = tup#位置
        board_todo = board
        #print(i,j)
        if (i,j) in self.chongfu:
            return False
        self.chongfu.append((i,j))
        dic_todo = dic
        loi = len(board)-1
        loj = len(board[0])-1
        if board[i][j] not in dic_todo:
            return False
        dic_todo = dic_todo[board[i][j]]
        ans = board[i][j]#该处值
        if '99999' in dic_todo:#到单词尽头
            return ans
        if j-1>=0 and (i,j-1) not in self.chongfu:         
            left = self.search2(dic_todo,board_todo,(i,j-1))
            if left:
                return (ans+left)
            self.chongfu.remove((i,j-1))
        if j+1<=loj and (i,j+1) not in self.chongfu:        
            right = self.search2(dic_todo,board_todo,(i,j+1))
            if right:
                return (ans+right)
            self.chongfu.remove((i,j+1))
        if i-1>=0 and (i-1,j) not in self.chongfu:         
            top = self.search2(dic_todo,board_todo,(i-1,j))
            if top:
                return (ans+top)
            self.chongfu.remove((i-1,j))
        if i+1<=loi and (i+1,j) not in self.chongfu:          
            bot = self.search2(dic_todo,board_todo,(i+1,j))
            if bot:
                return (ans+bot)
            self.chongfu.remove((i+1,j))


    def findWords(self, board, words):
        words_todo = words
        ans = []
        while True:
            inf = self.in_t(words_todo)
            s = self.search1(inf,board,words_todo)
            ans = ans+s
            if not s:
                break
        return(ans)


